import React from 'react';

const Footer = () => {
    return (
        <footer>
            <div className="flex flex-wrap items-center justify-between w-full">
                <div className="flex flex-row items-center justify-between space-y-3">
                    <a className="text-white font-bold">Created By<span className="text-blue-500 font-medium">Josi</span></a>
                </div>
            </div>
        </footer>
    )
}

export default Footer;
